import React from "react";
// import './index.css'
import {
    ThemeProvider,
    Editable,
    EditablePreview,
    EditableInput,
    Input,
    Button
} from "@chakra-ui/core";
function Index({ children }) {
    function addData() {
        const list = [];
    }
    return (
        <div className="App">
            <ThemeProvider>
                <Input placeholder="Basic usage" />
                <Button colorScheme="blue" onClick={addData}>按钮</Button>
                <h1>正在进行</h1>
                <p>
                    {
                        this.list.map(function (value, key) {
                            return (
                                <p className="vas" key={key}>
                                    <Editable defaultValue={value}>
                                        <EditablePreview></EditablePreview>
                                        <EditableInput></EditableInput>
                                    </Editable>
                                    <Button className="bot" onClick={this.handleLogoutClick()}>删除</Button>
                                </p>
                            )
                        })
                    }
                </p>
                <h1>已经完成</h1>
                <style jsx>
                    {`
            .App{
                width: 1100px;
                margin: 0 auto;
            }
            `}
                </style>
            </ThemeProvider>
        </div>
    );
}
// const Index = () => (
//     <div>
//         <p>1</p>
//     </div>
// )
export default Index
